import React, { Component } from "react";
import { Link } from "react-router-dom";

const liStyle = {
  display: "inline",
  padding: "100px 25px",
  fontFamily: "Arial"
};

const nameStyle = {
  float: "left",
  padding: "25px 50px",
  fontSize: "2em",
  fontFamily: "Raleway"
};

export class Menu extends Component {
  render() {
    return (
      <div>
        <header style={nameStyle}>Adam Pikielny</header>
        <ul>
          <li style={liStyle}>
            <Link to="/code">Code</Link>
          </li>
          <li style={liStyle}>
            <Link to="/videos">Videos</Link>
          </li>
          <li style={liStyle}>
            <Link to="/photos">Photos</Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default Menu;
